import PropTypes from "prop-types"
import Card from './shared/Card'
import {FaTimes} from 'react-icons/fa'

function Item({item}) {

  return (
    <Card>
       <div className="text-display">{item.text}</div>      
    </Card>
  )
}

Item.propType = {
  item: PropTypes.object.isRequired,
}

export default Item
